import React from "react";
import { useRoutes } from "react-router-dom";
import Home from "pages/Home";
import NotFound from "pages/NotFound";
import Users from "pages/Users";
import LOGIN from "pages/LOGIN";
import Home1 from "pages/Home1";
import Page3monitroing from "pages/Page3monitroing";
import Page3monitroingtimestampforallusers from "pages/Page3monitroingtimestampforallusers";

const ProjectRoutes = () => {
  let element = useRoutes([
    { path: "dhiwise-dashboard", element: <Home /> },
    { path: "*", element: <NotFound /> },
    {
      path: "/",
      element: <LOGIN />,
    },
    {
      path: "",
      element: <Users />,
    },
    {
      path: "home1",
      element: <Home1 />,
    },
    {
      path: "page3monitroing",
      element: <Page3monitroing />,
    },
    {
      path: "page3monitroingtimestampforallusers",
      element: <Page3monitroingtimestampforallusers />,
    },
  ]);

  return element;
};

export default ProjectRoutes;
